sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode == "201") 
        outputs.record = JSON.parse(inputs.response_body)["result"];
    else
        throw new Error("There was error in creating a record. Please check the response body for more details.");
})(inputs, outputs);

