sys_variable_value.value:
(function execute(inputs, outputs) {
    var body = JSON.parse(inputs.body);
    var payload = {
        "answer": body.correct,
        "machinename": gs.getProperty('glide.servlet.uri'),
        "opt_a": body.options[0],
        "opt_b": body.options[1],
        "opt_c": body.options[2],
        "opt_d": body.options[3],
        "question": body.question,
    };
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

